import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "../pages/Home";
import CreatePost from "../pages/Createpost";

export const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route path='/'>
                    <Home/>
                    </Route>
                    <Route path='/create'>
                    <CreatePost/>
                    </Route>
            </Switch>
            </Router>
    )
}
